webpackJsonp([175],{"./node_modules/json-loader/index.js!./.cache/json/articles-python-python-lenx-function.json":function(e,t){e.exports={data:{markdownRemark:{html:"<p><code>len()</code> is a built-in function in Python 3. This method returns the length (the number of items) of an object. It takes one argument <code>x</code>.</p>\n<h2>Arguments</h2>\n<p>It takes one argument, <code>x</code>. This argument may be a sequence (such as a string, bytes, tuple, list, or range) or a collection (such as a dictionary, set, or frozen set).</p>\n<h2>Return Value</h2>\n<p>This function returns the number of elements in the argument which is passed to the <code>len()</code> function.</p>\n<h2>Code Sample</h2>\n<pre><code>list1 = [123, 'xyz', 'zara'] # list\nprint(len(list1)) # prints 3 as there are 3 elements in the list1\n\nstr1 = 'basketball' # string\nprint(len(str1)) # prints 10 as the str1 is made of 10 characters\n\ntuple1 = (2, 3, 4, 5) # tuple \nprint(len(tuple1)) # prints 4 as there are 4 elements in the tuple1\n\ndict1 = {'name': 'John', 'age': 4, 'score': 45} # dictionary\nprint(len(dict1)) # prints 3 as there are 3 key and value pairs in the dict1\n</code></pre>\n<p><img src=\"//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2\" alt=\":rocket:\" title=\":rocket:\"> <a href=\"https://repl.it/CUmt/15\">Run Code</a></p>\n<p><a href=\"https://docs.python.org/3/library/functions.html#len\">Official Docs</a></p>",frontmatter:{title:"Python Lenx Function",parent:"/home/stuart/guides/src/pages/articles/python/python-lenx-function/index.md absPath of file"}}},pathContext:{slug:"/articles/python/python-lenx-function/"}}}});
